    employee_name: "",
    employee_surname: "",
    employee_birthday: "",
    employee_birthplace: "",
    city_id: "",
    district_id: "",
    address_type_id: "",

  })






  return (
    <div className='container'>
      <div className='row'>
        <div className='col-lg-6'>
          <label htmlFor="username"><h4>Enter name</h4></label>
          <input id="username" name="username" type="text" />

          <label htmlFor="surname">Enter surname</label>
          <input id="surname" name="surname" type="email" />

          <label htmlFor="birthdate">Enter your birth date</label>
          <input id="birthdate" name="birthdate" />

          <label htmlFor="birthplace">Enter your birthplace</label>
          <input name="birthplace" />

          <button>Save</button>
        </div>
      </div>
    </div>//Container



  );
}

export default App;
